import React from 'react';
import { useTranslation } from 'react-i18next';
import { 
  Code, 
  Globe, 
  Smartphone, 
  Database, 
  Cloud, 
  Zap,
  ArrowLeft,
  CheckCircle
} from 'lucide-react';
import { useNavigate } from 'react-router-dom';
import './DevelopmentPage.css';

const DevelopmentPage = () => {
  const { t } = useTranslation();
  const navigate = useNavigate();

  const developmentServices = [
    {
      icon: <Globe size={32} />,
      title: t('webDevelopment'),
      description: t('webDevelopmentDesc'),
      features: [
        t('responsiveDesign'),
        t('modernFrameworks'),
        t('performanceOptimized'),
        t('seoFriendly')
      ]
    },
    {
      icon: <Smartphone size={32} />,
      title: t('mobileDevelopment'),
      description: t('mobileDevelopmentDesc'),
      features: [
        t('crossPlatform'),
        t('nativePerformance'),
        t('userFriendlyUI'),
        t('appStoreReady')
      ]
    },
    {
      icon: <Database size={32} />,
      title: t('backendDevelopment'),
      description: t('backendDevelopmentDesc'),
      features: [
        t('scalableAPIs'),
        t('databaseDesign'),
        t('secureAuthentication'),
        t('cloudIntegration')
      ]
    },
    {
      icon: <Cloud size={32} />,
      title: t('cloudSolutions'),
      description: t('cloudSolutionsDesc'),
      features: [
        t('awsDeployment'),
        t('autoScaling'),
        t('microservices'),
        t('devOpsIntegration')
      ]
    }
  ];

  const technologies = [
    'React', 'Node.js', 'Python', 'TypeScript', 'Next.js', 'Express',
    'MongoDB', 'PostgreSQL', 'AWS', 'Docker', 'Kubernetes', 'GraphQL'
  ];

  return (
    <div className="development-page">
      {/* Header Section */}
      <div className="dev-header">
        <button 
          className="back-button"
          onClick={() => navigate(-1)}
        >
          <ArrowLeft size={20} />
          {t('back')}
        </button>
        
        <div className="dev-hero">
          <div className="hero-icon">
            <Code size={48} />
          </div>
          <h1>{t('developmentServices')}</h1>
          <p className="hero-subtitle">{t('developmentHeroDesc')}</p>
        </div>
      </div>

      {/* Services Grid */}
      <section className="dev-services-section">
        <div className="container">
          <h2>{t('ourDevelopmentServices')}</h2>
          <div className="dev-services-grid">
            {developmentServices.map((service, index) => (
              <div key={index} className="dev-service-card">
                <div className="service-icon">{service.icon}</div>
                <h3>{service.title}</h3>
                <p>{service.description}</p>
                <ul className="features-list">
                  {service.features.map((feature, idx) => (
                    <li key={idx}>
                      <CheckCircle size={16} />
                      <span>{feature}</span>
                    </li>
                  ))}
                </ul>
                <button className="learn-more-btn">{t('learnMore')}</button>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Technologies Section */}
      <section className="technologies-section">
        <div className="container">
          <h2>{t('technologiesWeUse')}</h2>
          <div className="tech-grid">
            {technologies.map((tech, index) => (
              <div key={index} className="tech-tag">
                <Zap size={16} />
                {tech}
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="dev-cta-section">
        <div className="container">
          <div className="cta-content">
            <h2>{t('readyToStartProject')}</h2>
            <p>{t('ctaDescription')}</p>
            <div className="cta-buttons">
              <button className="primary-btn">{t('getQuote')}</button>
              <button className="secondary-btn">{t('viewPortfolio')}</button>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default DevelopmentPage;
